import React from "react";
import { useSelector } from "react-redux";
import styled from "styled-components";

export const Navbar = () => {
  const isSignedIn = useSelector((store) => store.user.login.isSignedIn);

  if (isSignedIn) {
    return (
      <nav>
        <ul>
          <li>Home</li>
          <li>My grids</li>
          <li>Connected grids</li>
          <li>About</li>
          <li>Sign out</li>
        </ul>
      </nav>
    );
  } else {
    return (
      <nav>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Sign up/Log in</li>
        </ul>
      </nav>
    );
  }
};
